    private static List<Integer> findAnagrams(String s, String p) {
        List<Integer> arr = new ArrayList<>();
        int[] ascii = new int[123];
        for(int i=0; i<p.length(); i++) {
            ascii[p.charAt(i)-'0']++;
        }

        System.out.println();
        int lp=0, rp=p.length();

        while(rp<=s.length() && lp<rp) {
            int lpMove = 0;
            while(lp+lpMove < rp && ascii[s.charAt(lp+lpMove)-'0']!=0){
                ascii[s.charAt(lp+lpMove)-'0']--;
                lpMove++;
            }
            ascii = new int[123];
            for(int i=0; i<p.length(); i++) {
                ascii[p.charAt(i)-'0']++;
            }
            if(lpMove == p.length()) {
                arr.add(lp);
//                lp = rp+1-lpMove;
//                rp++;
            } else {
//                lp=lp+lpMove+1;
//                rp = lp+p.length();
            }
            lp++;
            rp++;

        }

        return arr;
    }
